import React, { useState, useContext } from "react";
import { useNavigate } from "react-router-dom";
import { Box, Typography, TextField, Button } from "@mui/material";
import { LanguageContext } from "../context/LanguageContext";

const translations = {
    BM: { securityQ: "Soalan Keselamatan", q1: "Jawapan Soalan 1", q2: "Jawapan Soalan 2", finish: "Selesai" },
    BO: { securityQ: "Security Questions", q1: "Answer Question 1", q2: "Answer Question 2", finish: "Finish Signup" },
};

const SignUpSecurity: React.FC = () => {
    const navigate = useNavigate();
    const { language } = useContext(LanguageContext);

    const [q1, setQ1] = useState("");
    const [q2, setQ2] = useState("");

    const handleNext = () => {
        navigate("/user-mode");
    };

    return (
        <Box textAlign="center" mt={5}>
            <Typography variant="h4">{translations[language].securityQ}</Typography>
            <TextField label={translations[language].q1} value={q1} onChange={(e) => setQ1(e.target.value)} fullWidth sx={{ my: 1 }} />
            <TextField label={translations[language].q2} value={q2} onChange={(e) => setQ2(e.target.value)} fullWidth sx={{ my: 1 }} />
            <Button variant="contained" sx={{ mt: 3 }} onClick={handleNext}>
                {translations[language].finish}
            </Button>
        </Box>
    );
};

export default SignUpSecurity;
